import React from 'react'

const TotalCost = (props) => {

    console.log(props.products)

    return (
        <div className="totalCost-elements">
            <img style={{ paddingTop: "40px" }} src={require('./images/shop.png')} alt="shopping cart" width="120" height="100" ></img>
            {<p style={{ margin: "0", paddingTop: "80px", paddingRight: "200px" }}>
                {props.products[0].price * props.products[0].amount + props.products[1].price * props.products[1].amount + props.products[2].price * props.products[2].amount}
                $
    </p>}

        </div>
    )
}

export default TotalCost;
